import styles from "./App.module.css";
import { useState, useEffect } from "react";

function App() {
  const [val, setVal] = useState();
  const onChange = (event) => {
    setVal(event.target.value);
  };
  return (
    <div>
      <input
        onChange={onChange}
        value={val}
        type="text"
        placeholder="Write Your todo"
      />
      ;
    </div>
  );
}

export default App;
